import React from "react"
import styled from "styled-components"
import { Container, Title } from "./contants"
import API from "./file"
const Wrapper = styled.ul``
const Item = styled.li`
  list-style: none;
`
const Name = styled.p``

const mai = [
  {
    voice_id: 1,
    audioCredit: {
      audio: "talk1.mp3",
      type: "audio",
      agent: {
        cty: "ABC",
        hotline: 19636666,
        agent: [
          {
            agentID: 1,
            name: "Nguyễn Văn Đòi Nợ 1",
          },
          {
            agentID: 2,
            name: "Nguyễn Văn Đòi Nợ 2",
          },
        ],
      },
      customer: {
        name: "Nguyễn Văn Nợ",
        phone: 12345689,
        address: "Hà Nội",
        cmnd: 789456321,
      },
      callHoldDration: "0s",
      callDuration: "20s",
      date: "01/01/2022",
      time_start: "10:40:20",
    },
    audioText: [
      {
        voiceLayer: {
          voiceNumber: "First",
          voicePrediction: 1,
          text: [
            {
              duration: 0.05,
              content: "xin chào",
            },
            {
              duration: 0.1,
              content: "bạn có mượn tôi ba triệu",
            },
          ],
        },
      },
      {
        voiceLayer: {
          voiceNumber: "Second",
          voicePrediction: 2,
          text: [
            {
              duration: 0.1,
              content: "xin chào",
            },
            {
              duration: 0.2,
              content: "ừ đúng ròi",
            },
          ],
        },
      },
    ],
    audioMatch: {
      rules: [
        {
          name: "wrong number",
          key: [
            {
              agent: [
                "anh có mượn nợ bênh em phải k",
                "anh mượn nợ",
                "anh nợ cty",
              ],
              customer: [
                "không em ơi",
                "lộn số ròi em",
                "anh có mượn cty đâu",
                "anh không có mượn nợ",
                "không có",
                "anh đâu biết",
              ],
            },
          ],
        },
        {
          name: "notify payment duedate",
          key: [
            {
              agent: [
                "quá hạn",
                "hết ngày thanh toán",
                "năm triệu",
                "chưa thanh toán",
                "anh chưa thanh toán",
              ],
              customer: [
                "ừ",
                "anh quên",
                "anh k có tiền",
                "anh không trả",
                "không có",
                "anh không biết",
                "đâu biết",
              ],
            },
          ],
        },
      ],
    },
  },
]

const Alerts = () => {
  console.log(API.length)
  return (
    <Container>
      <Title>Alerts</Title>
      <Wrapper>
        {/* {API.map((item) => (
          <Item>
            <Name>{item.name}</Name>
          </Item>
        ))} */}
      </Wrapper>
    </Container>
  )
}

export default Alerts
